original_question:
Dvylika 1 ant 1 kvadratų sudaro stačiakampį, kaip parodyta. Kokia yra visa šešėliuotos srities plotas? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Užpildytos dalys
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// tinklelis
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

// įstrižainės
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

question:
Dvylika 1 ant 1 kvadratų sudaro stačiakampį, kaip parodyta. Kokia yra visa šešėliuotos srities plotas? [asy]
size(4cm);defaultpen(linewidth(0.75));

// Užpildytos dalys
fill((0, 4)--(0, 0)--(2, 0)--cycle, gray(0.75));
fill((0, 4)--(3, 4)--(3, 0)--cycle, gray(0.75));

// tinklelis
int j;
for (j = 0; j < 4; ++j) {draw((j, 0)--(j, 4));}
for (j = 0; j < 5; ++j) {draw((0, j)--(3, j));}

// įstrižainės
draw((0, 4)--(3, 0)); draw((0, 4)--(2, 0));
[/asy]

