Juanas organizuoja savo kolekcijos pašto ženklus pagal šalį ir dešimtmetį, kuriame jie buvo išleisti. Kainos, kurias jis mokėjo už juos pašto ženklų parduotuvėje, buvo: Brazilija ir Prancūzija, po $6$ centus už kiekvieną, Peru $4$ centus už kiekvieną, ir Ispanija $5$ centus už kiekvieną. (Brazilija ir Peru yra Pietų Amerikos šalys, o Prancūzija ir Ispanija yra Europoje.) [asy]
